'''
Colour here:        G G        B G        R G        B R
Becomes colour:      G          R          B          G


R R G B R G B B
 R B R G B R B
  G G B R G G
   G R G B G
    B B R R
     B G R
      R B
       G

'''


def triangle(str):
    d = {'GG': 'G', 'RR': 'R', 'BB': 'B', 'BG': 'R', 'GB': 'R', 'RG': 'B', 'GR': 'B', 'RB': 'G', 'BR': 'G'}
    n = list(str)
    while len(n) > 1:
        temp = ''
        for i, v in enumerate(n[:-1]):
            temp+=d[n[i]+n[i+1]]
        n = temp
    return n[0]


